str=str.replace(/\\/gi,"\\\\");
str=str.replace(/\./gi,"\\\.");
str=str.replace(/\?/gi,"\\\?");
str=str.replace(/\!/gi,"\\\!");
str=str.replace(/\^/gi,"\\\^");
str=str.replace(/\(/gi,"\\\(");
str=str.replace(/\)/gi,"\\\)");
str=str.replace(/\[/gi,"\\\[");
